import logo from './logo.svg';

function App() {
  return (
    <div>
      <header className="bg-red-800 min-h-screen flex flex-col items-center justify-center text-white text-[calc(10px+2vmin)]">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
          Learn React
      </header>
    </div>
  );
}

export default App;
